-- ------------------------------------------------------------------------------------------------
-- Set the schema which is to be used
-- ------------------------------------------------------------------------------------------------
SET SCHEMA 'sams_place';


-- ------------------------------------------------------------------------------------------------
-- Drop the triggers
-- ------------------------------------------------------------------------------------------------
DROP TRIGGER IF EXISTS bi_place ON place CASCADE;
DROP TRIGGER IF EXISTS bi_place_name ON place_name CASCADE;
DROP TRIGGER IF EXISTS bi_place_rep ON place_rep CASCADE;
DROP TRIGGER IF EXISTS bi_rep_disp_name ON rep_display_name CASCADE;
DROP TRIGGER IF EXISTS bi_rep_attr ON rep_attr CASCADE;
DROP TRIGGER IF EXISTS bi_rep_bndry ON rep_bndry CASCADE;
DROP TRIGGER IF EXISTS bi_plc_version ON place_version CASCADE;
DROP TRIGGER IF EXISTS bi_source ON source_info CASCADE;
DROP TRIGGER IF EXISTS bi_source_link ON source_link CASCADE;
DROP TRIGGER IF EXISTS bi_place_type_group ON place_type_group CASCADE;
DROP TRIGGER IF EXISTS bi_place_type_group_member ON place_type_group_member CASCADE;
DROP TRIGGER IF EXISTS bi_place_type_sub_group ON place_type_sub_group CASCADE;


