INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(900, 408, 'en', 'Reef(s)', 'a surface-navigation hazard composed of consolidated material', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(901, 409, 'en', 'Coral Reef(s)', 'a surface-navigation hazard composed of coral', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(902, 410, 'en', 'Section Of Reef', 'Section Of Reef', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(903, 411, 'en', 'Rapids', 'a turbulent section of a stream associated with a steep, irregular stream bed; fast-flowing section of a stream, often shallow and with exposed rock or boulders (riffle, ripple).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(904, 412, 'en', 'Reservoir(s)', 'an artificial pond or lake; artificially impounded body of water (lake, tank).', 'sams_place');
