INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(906, 414, 'en', 'Water Tank', 'a contained pool or tank of water at, below, or above ground level', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(907, 415, 'en', 'Ravine(s)', 'a small, narrow, deep, steep-sided stream channel, smaller than a gorge; watercourse or channel through which water may occasionally flow (coulee, draw, gully, wash). Also called an arroyo.', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(908, 416, 'en', 'Sabkha(s)', 'a salt flat or salt encrusted plain subject to periodic inundation from flooding or high tides', 'sams_place');
