INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(913, 421, 'en', 'Spring(s)', 'a place where ground water flows naturally out of the ground; place where underground water flows naturally to the surface of the Earth (seep).', 'sams_place');
