INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(915, 423, 'en', 'Hot Spring(s)', 'a place where hot ground water flows naturally out of the ground', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(916, 424, 'en', 'Stream', 'a body of running water moving to a lower level in a channel on land; linear body of water flowing on the Earth''s surface (anabranch, awawa, bayou, branch, brook, creek, distributary, fork, kill, pup, rio, river, run, slough).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(917, 425, 'en', 'Anabranch', 'a diverging branch flowing out of a main stream and rejoining it downstream', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(918, 426, 'en', 'Stream Bend', 'a conspicuously curved or bent segment of a stream; curve in the course of a stream and (or) the land within the curve; a curve in a linear body of water (bottom, loop, meander).', 'sams_place');
