INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(925, 433, 'en', 'Abandoned Watercourse', 'a former stream or distributary no longer carrying flowing water, but still evident due to lakes, wetland, topographic or vegetation patterns', 'sams_place');
