INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(930, 438, 'en', 'Swamp', 'a wetland dominated by tree vegetation; poorly drained wetland, fresh or saltwater, wooded or grassy, possibly covered with open water (bog, cienega, marais, marsh, pocosin).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(931, 439, 'en', 'Irrigation System', 'a network of ditches and one or more of the following elements:  water supply, reservoir, canal, pump, well, drain, etc.', 'sams_place');
