INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1277, 783, 'en', 'Cirque', 'a bowl-like hollow partially surrounded by cliffs or steep slopes at the head of a glaciated valley', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1278, 784, 'en', 'Cirques', 'bowl-like hollows partially surrounded by cliffs or steep slopes at the head of a glaciated valley', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1279, 785, 'en', 'Crater(s)', 'a bowl-shaped depression caused by volcanic or meteorite explosive action; depression at the summit of a volcanic cone or one on the surface of the land caused by the impact of a meteorite; a manmade depression caused by an explosion (caldera, lua).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1280, 786, 'en', 'Cuesta(s)', 'an asymmetric ridge formed on tilted strata', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1281, 787, 'en', 'Delta', 'a flat plain formed by alluvial deposits at the mouth of a stream', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1282, 788, 'en', 'Depression(s)', 'a low area surrounded by higher land and usually characterized by interior drainage', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1283, 789, 'en', 'Desert', 'a large area with little or no vegetation due to extreme environmental conditions', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1284, 790, 'en', 'Dune(s)', 'a wave form, ridge or star shape feature composed of sand', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1285, 791, 'en', 'Divide', 'a line separating adjacent drainage basins', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1286, 792, 'en', 'Sandy Desert', 'an extensive tract of shifting sand and sand dunes', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1287, 793, 'en', 'Fan(s)', 'a fan-shaped wedge of coarse alluvium with apex merging with a mountain stream bed and the fan spreading out at a low angle slope onto an adjacent plain', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1288, 794, 'en', 'Ford', 'a shallow part of a stream which can be crossed on foot or by land vehicle; a place where two or more routes of transportation form a junction or intersection (overpass, underpass). Also called a crossing.', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1289, 795, 'en', 'Fissure', 'a crack associated with volcanism', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1290, 796, 'en', 'Gap', 'a low place in a ridge, not used for transportation', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1291, 797, 'en', 'Gorge(s)', 'a short, narrow, steep-sided section of a stream valley', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1292, 798, 'en', 'Headland', 'a high projection of land extending into a large body of water beyond the line of the coast', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1293, 799, 'en', 'Hill', 'a rounded elevation of limited extent rising above the surrounding land with local relief of less than 300m', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1294, 800, 'en', 'Hills', 'rounded elevations of limited extent rising above the surrounding land with local relief of less than 300m', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1295, 801, 'en', 'Hammock(s)', 'a patch of ground, distinct from and slightly above the surrounding plain or wetland. Often occurs in groups', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1296, 802, 'en', 'Rock Desert', 'a relatively sand-free, high bedrock plateau in a hot desert, with or without a gravel veneer', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1297, 803, 'en', 'Interfluve', 'a relatively undissected upland between adjacent stream valleys', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1298, 804, 'en', 'Island', 'a tract of land, smaller than a continent, surrounded by water at high water; area of dry or relatively dry land surrounded by water or low wetland (archipelago, atoll, cay, hammock, hummock, isla, isle, key, moku, rock).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1299, 805, 'en', 'Artificial Island', 'an island created by landfill or diking and filling in a wetland, bay, or lagoon', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1300, 806, 'en', 'Mangrove Island', 'a mangrove swamp surrounded by a waterbody', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1301, 807, 'en', 'Islands', 'tracts of land, smaller than a continent, surrounded by water at high water', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1302, 808, 'en', 'Land-Tied Island', 'a coastal island connected to the mainland by barrier beaches, levees or dikes', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1303, 809, 'en', 'Section Of Island', 'Section Of Island', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1304, 810, 'en', 'Isthmus', 'a narrow strip of land connecting two larger land masses and bordered by water; narrow section of land in a body of water connecting two larger land areas.', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1305, 811, 'en', 'Karst Area', 'a distinctive landscape developed on soluble rock such as limestone characterized by sinkholes, caves, disappearing streams, and underground drainage', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1306, 812, 'en', 'Lava Area', 'an area of solidified lava', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1307, 813, 'en', 'Levee', 'a natural low embankment bordering a distributary or meandering stream; often built up artificially to control floods; natural or manmade embankment flanking a stream (bank, berm).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1308, 814, 'en', 'Mesa(s)', 'a flat-topped, isolated elevation with steep slopes on all sides, less extensive than a plateau', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1309, 815, 'en', 'Mound(s)', 'a low, isolated, rounded hill', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1310, 816, 'en', 'Moraine', 'a mound, ridge, or other accumulation of glacial till', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1311, 817, 'en', 'Mountain', 'an elevation standing high above the surrounding area with small summit area, steep slopes and local relief of 300m or more. Also called a summit.', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1312, 818, 'en', 'Mountains', 'a mountain range or a group of mountains or high ridges; chain of hills or mountains; a somewhat linear, complex mountainous or hilly area (cordillera, sierra). Also called a range.', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1313, 819, 'en', 'Meander Neck', 'a narrow strip of land between the two limbs of a meander loop at its narrowest point', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1314, 820, 'en', 'Nunatak', 'a rock or mountain peak protruding through glacial ice', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1315, 821, 'en', 'Nunataks', 'rocks or mountain peaks protruding through glacial ice', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1316, 822, 'en', 'Pan', 'a near-level shallow, natural depression or basin, usually containing an intermittent lake, pond, or pool', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1317, 823, 'en', 'Pans', 'a near-level shallow, natural depression or basin, usually containing an intermittent lake, pond, or pool', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1318, 824, 'en', 'Pass', 'a break in a mountain range or other high obstruction, used for transportation from one side to the other [See also gap]', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1319, 825, 'en', 'Peninsula', 'an elongate area of land projecting into a body of water and nearly surrounded by water', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1320, 826, 'en', 'Section Of Peninsula', 'Section Of Peninsula', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1321, 827, 'en', 'Peak', 'a pointed elevation atop a mountain, ridge, or other hypsographic feature', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1322, 828, 'en', 'Peaks', 'pointed elevations atop a mountain, ridge, or other hypsographic features', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1323, 829, 'en', 'Plateau', 'an elevated plain with steep slopes on one or more sides, and often with incised streams', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1324, 830, 'en', 'Section Of Plateau', 'Section Of Plateau', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1325, 831, 'en', 'Polder', 'an area reclaimed from the sea by diking and draining', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1326, 832, 'en', 'Plain(s)', 'an extensive area of comparatively level to gently undulating land, lacking surface irregularities, and usually adjacent to a higher area; a region of general uniform slope, level and of considerable extent (grassland, highland, kula, plateau, upland).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1327, 833, 'en', 'Section Of Plain', 'Section Of Plain', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1328, 834, 'en', 'Promontory(-Ies)', 'a bluff or prominent hill overlooking or projecting into a lowland', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1329, 835, 'en', 'Point', 'a tapering piece of land projecting into a body of water, less prominent than a cape', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1330, 836, 'en', 'Points', 'tapering pieces of land projecting into a body of water, less prominent than a cape', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1331, 837, 'en', 'Beach Ridge', 'a ridge of sand just inland and parallel to the beach, usually in series', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1332, 838, 'en', 'Ridge(s)', 'a long narrow elevation with steep sides, and a more or less continuous crest; elevation with a narrow, elongated crest which can be part of a hill or mountain (crest, cuesta, escarpment, hogback, lae, rim, spur).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1333, 839, 'en', 'Stony Desert', 'a desert plain characterized by a surface veneer of gravel and stones', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1334, 840, 'en', 'Rock', 'a conspicuous, isolated rocky mass. Also called a pillar.', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1335, 841, 'en', 'Rockfall', 'an irregular mass of fallen rock at the base of a cliff or steep slope', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1336, 842, 'en', 'Rocks', 'conspicuous, isolated rocky masses', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1337, 843, 'en', 'Sand Area', 'a tract of land covered with sand', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1338, 844, 'en', 'Dry Stream Bed', 'a channel formerly containing the water of a stream', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1339, 845, 'en', 'Escarpment', 'a long line of cliffs or steep slopes separating level surfaces above and below', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1340, 846, 'en', 'Saddle', 'a broad, open pass crossing a ridge or between hills or mountains', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1341, 847, 'en', 'Shore', 'a narrow zone bordering a waterbody which covers and uncovers at high and low water, respectively', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1342, 848, 'en', 'Sinkhole', 'a small crater-shape depression in a karst area', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1343, 849, 'en', 'Slide', 'a mound of earth material, at the base of a slope and the associated scoured area', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1344, 850, 'en', 'Slope(s)', 'a surface with a relatively uniform slope angle; a gently inclined part of the Earth''s surface (grade, pitch).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1345, 851, 'en', 'Spit', 'a narrow, straight or curved continuation of a beach into a waterbody', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1346, 852, 'en', 'Spur(s)', 'a subordinate ridge projecting outward from a hill, mountain or other elevation', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1347, 853, 'en', 'Talus Slope', 'a steep concave slope formed by an accumulation of loose rock fragments at the base of a cliff or steep slope', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1348, 854, 'en', 'Interdune Trough(s)', 'a long wind-swept trough between parallel longitudinal dunes', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1349, 855, 'en', 'Terrace', 'a long, narrow alluvial platform bounded by steeper slopes above and below, usually overlooking a waterbody', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1350, 856, 'en', 'Upland', 'an extensive interior region of high land with low to moderate surface relief', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1351, 857, 'en', 'Valley', 'an elongated depression usually traversed by a stream; linear depression in the Earth''s surface that generally slopes from one end to the other (barranca, canyon, chasm, cove, draw, glen, gorge, gulch, gulf, hollow, ravine).', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1352, 858, 'en', 'Hanging Valley', 'a valley the floor of which is notably higher than the valley or shore to which it leads; most common in areas that have been glaciated', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1353, 859, 'en', 'Valleys', 'elongated depressions usually traversed by a stream', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1354, 860, 'en', 'Section Of Valley', 'Section Of Valley', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1355, 861, 'en', 'Volcano', 'a conical elevation composed of volcanic materials with a crater at the top', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1356, 862, 'en', 'Apron', 'a gentle slope, with a generally smooth surface, particularly found around groups of islands and seamounts', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1357, 863, 'en', 'Arch', 'a low bulge around the southeastern end of the island of Hawaii', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1358, 864, 'en', 'Arrugado', 'an area of subdued corrugations off Baja California', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1359, 865, 'en', 'Borderland', 'a region adjacent to a continent, normally occupied by or bordering a shelf, that is highly irregular with depths well in excess of those typical of a shelf', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1360, 866, 'en', 'Banks', 'elevations, typically located on a shelf, over which the depth of water is relatively shallow but sufficient for safe surface navigation', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1361, 867, 'en', 'Bank', 'an elevation, typically located on a shelf, over which the depth of water is relatively shallow but sufficient for safe surface navigation', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1362, 868, 'en', 'Basin', 'a depression more or less equidimensional in plan and of variable extent', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1363, 869, 'en', 'Cordillera', 'an entire mountain system including the subordinate ranges, interior plateaus, and basins', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1364, 870, 'en', 'Canyons', 'relatively narrow, deep depressions with steep sides, the bottom of which generally has a continuous slope', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1365, 871, 'en', 'Canyon', 'a relatively narrow, deep depression with steep sides, the bottom of which generally has a continuous slope', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1366, 872, 'en', 'Deep', 'a localized deep area within the confines of a larger feature, such as a trough, basin or trench', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1367, 873, 'en', 'Shelf Edge', 'a line along which there is a marked increase of slope at the outer margin of a continental shelf or island shelf', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1368, 874, 'en', 'Escarpment (Or Scarp)', 'an elongated and comparatively steep slope separating flat or gently sloping areas', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1369, 875, 'en', 'Fan', 'a relatively smooth feature normally sloping away from the lower termination of a canyon or canyon system', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1370, 876, 'en', 'Flat', 'a small level or nearly level area', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1371, 877, 'en', 'Fracture Zone', 'an extensive linear zone of irregular topography of the sea floor, characterized by steep-sided or asymmetrical ridges, troughs, or escarpments', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1372, 878, 'en', 'Furrow', 'a closed, linear, narrow, shallow depression', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1373, 879, 'en', 'Gap', 'a narrow break in a ridge or rise', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1374, 880, 'en', 'Hill', 'an elevation rising generally less than 500 meters', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1375, 881, 'en', 'Hills', 'elevations rising generally less than 500 meters', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1376, 882, 'en', 'Hole', 'a small depression of the sea floor', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1377, 883, 'en', 'Knoll', 'an elevation rising generally more than 500 meters and less than 1,000 meters and of limited extent across the summit', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1378, 884, 'en', 'Knolls', 'elevations rising generally more than 500 meters and less than 1,000 meters and of limited extent across the summits', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1379, 885, 'en', 'Ledge', 'a rocky projection or outcrop, commonly linear and near shore', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1380, 886, 'en', 'Mesa', 'an isolated, extensive, flat-topped elevation on the shelf, with relatively steep sides', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1381, 887, 'en', 'Mound', 'a low, isolated, rounded hill', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1382, 888, 'en', 'Moat', 'an annular depression that may not be continuous, located at the base of many seamounts, islands, and other isolated elevations', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1383, 889, 'en', 'Peak', 'a prominent elevation, part of a larger feature, either pointed or of very limited extent across the summit', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1384, 890, 'en', 'Plain', 'a flat, gently sloping or nearly level region', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1385, 891, 'en', 'Plateau', 'a comparatively flat-topped feature of considerable extent, dropping off abruptly on one or more sides', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1386, 892, 'en', 'Pinnacle', 'a high tower or spire-shaped pillar of rock or coral, alone or cresting a summit', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1387, 893, 'en', 'Province', 'a region identifiable by a group of similar physiographic features whose characteristics are markedly in contrast with surrounding areas', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1388, 894, 'en', 'Ravine', 'a small canyon', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1389, 895, 'en', 'Ridge', 'a long narrow elevation with steep sides', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1390, 896, 'en', 'Ridges', 'long narrow elevations with steep sides', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1391, 897, 'en', 'Reefs', 'surface-navigation hazards composed of consolidated material', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1392, 898, 'en', 'Reef', 'a surface-navigation hazard composed of consolidated material', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1393, 899, 'en', 'Rise', 'a broad elevation that rises gently, and generally smoothly, from the sea floor', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1394, 900, 'en', 'Seachannel', 'a continuously sloping, elongated depression commonly found in fans or plains and customarily bordered by levees on one or two sides', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1395, 901, 'en', 'Seachannels', 'continuously sloping, elongated depressions commonly found in fans or plains and customarily bordered by levees on one or two sides', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1396, 902, 'en', 'Saddle', 'a low part, resembling in shape a saddle, in a ridge or between contiguous seamounts', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1397, 903, 'en', 'Shelf', 'a zone adjacent to a continent (or around an island) that extends from the low water line to a depth at which there is usually a marked increase of slope towards oceanic depths', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1398, 904, 'en', 'Shoal', 'a surface-navigation hazard composed of unconsolidated material', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1399, 905, 'en', 'Shoals', 'hazards to surface navigation composed of unconsolidated material', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1400, 906, 'en', 'Shelf Valley', 'a valley on the shelf, generally the shoreward extension of a canyon', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1401, 907, 'en', 'Sill', 'the low part of a gap or saddle separating basins', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1402, 908, 'en', 'Slope', 'the slope seaward from the shelf edge to the beginning of a continental rise or the point where there is a general reduction in slope', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1403, 909, 'en', 'Seamounts', 'elevations rising generally more than 1,000 meters and of limited extent across the summit', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1404, 910, 'en', 'Seamount', 'an elevation rising generally more than 1,000 meters and of limited extent across the summit', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1405, 911, 'en', 'Spur', 'a subordinate elevation, ridge, or rise projecting outward from a larger feature', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1406, 912, 'en', 'Terrace', 'a relatively flat horizontal or gently inclined surface, sometimes long and narrow, which is bounded by a steeper ascending slope on one side and by a steep descending slope on the opposite side', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1407, 913, 'en', 'Tablemounts (Or Guyots)', 'seamounts having a comparatively smooth, flat top', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1408, 914, 'en', 'Tablemount (Or Guyot)', 'a seamount having a comparatively smooth, flat top', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1409, 915, 'en', 'Tongue', 'an elongate (tongue-like) extension of a flat sea floor into an adjacent higher feature', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1410, 916, 'en', 'Trough', 'a long depression of the sea floor characteristically flat bottomed and steep sided, and normally shallower than a trench', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1411, 917, 'en', 'Trench', 'a long, narrow, characteristically very deep and asymmetrical depression of the sea floor, with relatively steep sides', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1412, 918, 'en', 'Valley', 'a relatively shallow, wide depression, the bottom of which usually has a continuous gradient', 'sams_place');
INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1413, 919, 'en', 'Valleys', 'a relatively shallow, wide depression, the bottom of which usually has a continuous gradient', 'sams_place');
