INSERT INTO type_term(term_id, type_id, locale, text, description, update_id) VALUES(1416, 922, 'en', 'Forest(s)', 'an area dominated by tree vegetation; small area covered with a dense growth of trees; does not include an area of trees under the administration of a political agency (see forest). The terms woods and forest have been combined.', 'sams_place');
